import React, { useState } from 'react';
import UploadProduct from '../../global/Upload/UploadProduct';
import { WrapperTitle } from './styles';
import { Form, Button, Typography } from 'antd';
const { Title } = Typography;

const NewProduct = () => {
  const [loading, setloading] = useState(false);
  const onFinish = (values) => {
    console.log('Success:', values);
  };

  const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };
  return (
    <div>
      <WrapperTitle>
        <Title type='secondary'>Cargar Nuevo Producto </Title>
      </WrapperTitle>
      <Form
        name='basic'
        initialValues={{ remember: true }}
        onFinish={onFinish}
        onFinishFailed={onFinishFailed}>
        <Form.Item label='' name='email' rules={[{ required: true, message: 'Ingrese email' }]}>
          <CustomInput placeholder='Email' />
        </Form.Item>

        <Form.Item>
          <Button
            type='primary'
            ghost
            block
            style={{ color: '#111d2c' }}
            loading={loading}
            htmlType='submit'>
            Restablecer
          </Button>
        </Form.Item>
      </Form>
      <UploadProduct />
    </div>
  );
};

export default NewProduct;
